from eth_abi import decode_single

"""
Contains 6 x 64 characters (6 x 32 bytes)
"""
DATA = ""

if __name__ == "__main__":
    hex = bytes.fromhex(DATA[2:])
    abi = "(uint256,uint256,uint256,uint256)"
    decoded = decode_single(abi, hex)
    print("Decoded:", decoded)
    assert len(decoded) == 4
    assert decoded[0] == 0
    assert decoded[1] == 0
    assert decoded[2] == 0
    assert decoded[3] == 100272966473279886833676452
